import React from 'react';
import './master.css';
//import Equipo from "./Equipo";

class Equipos extends React.Component {

state = { equipos : []};

componentDidMount() {
    this.setState({ equipos: [{ nombre: "Los gladiadores", color: "azul", integrantes: [ { nombre: "Mick Jagger"}, { nombre: "Michael Jackson"}]}]});
	             }


render() { 

  return (  
            <div className="App">
              <div className="banner-container">
              <img src="/images/map_banner.png"/>
                <div className="banner-text">Hackathon blablabla</div>
              </div>
	      <p className="map-title" align="center">EQUIPOS</p>
	      <img src="/images/linea1.png"/>

	      <div className="warrior"><img src="/images/warrior.png"/></div>
	      <div className="tableEquipos">
	      <div className="row">
	      <span className="cell bandera"><img src="/images/bandera-azul.png"/></span>
	      <span className="cell"><div className="tableIntegrantes"><div className="row"><span className="cell"><p className="map-title">INTEGRANTES</p></span></div>
	      <div className="row">
	             <span className="cell integrante">Mick Jagger </span></div>
	      <div className="row">
	             <span className="cell integrante">Michael Jackson </span></div>
	      </div></span>
	      </div>
	      <div className="row">
	      <span className="cell nombreEquipo"><img src="/images/linea1.png"/></span></div>
	      <div className="row">
	      <span className="cell nombreEquipo"><p className="map-title">LOS GLADIADORES</p></span></div> 
	      </div>

     </div>
  )

}

}     


export default Equipos;
